CREATE TABLE eclipse_solaire(id_eclipse_solaire INT PRIMARY KEY,Gamma VARCHAR(10),Eclipse_Magnitude VARCHAR(10),Path_Width_km VARCHAR(10),Central_Duration VARCHAR(10),id_phénomene INT,id_localisation INT,type_eclipse INT,id_date INT, FOREIGN KEY (id_phénomene) REFERENCES phenomenes(id_phénomene), FOREIGN KEY (id_localisation) REFERENCES localisation(id_local), FOREIGN KEY (type_eclipse) REFERENCES type_eclipse(id_eclipse), FOREIGN KEY (id_date) REFERENCES date(id_date));
